    {name:'Contact'},
    {name: 'Resume'}
  ]);
  const [currentChoice, setCurrentChoice] = useState(choices[0]);
  return (
    <div>
   <Nav
     choices={choices}
     setCurrentChoice={setCurrentChoice}
     currentChoice={currentChoice}

   ></Nav>

    <main>
      <div>
      <About></About>
      </div>
    </main>
    </div>
  )
  }
export default App;
